// 컴포넌트를 생성할 경우 카멜표기법을 사용하고
// 첫글자는 항상 대문자로 표기하여야한다.
// ex) ExpenseItem 처럼 말이다.
function ExpenseItem() {
  //   return <h2>Expens item!</h2>;

  return (
    <div>
      <div>Date</div>
      <div>
        <h2>Title</h2>
        <div>Amount</div>
      </div>
    </div>
  );
  // 여러개의 태그를 return 하기 위해서는
  // <div></div>로 감싸주어야한다.
}

export default ExpenseItem;
